import React from 'react';
import Socket from 'socket.io-client';

const SERVER_URL = 'localhost:5000';

export const Chat = () => {
  const socket = Socket(SERVER_URL);

  socket.on('connection', () => {
    console.log('connected');
  });

  return <h1>Chat</h1>;
};
